import React from "react";
import { Typography, Space, Row, Col, Button } from "antd";
import { useRouter } from "next/router";
const { Text } = Typography;

import dog from "../assets/dog.png";
import cat from "../assets/cat.png";

const Home = () => {
	const router = useRouter();

	const toDog = () => {
		router.push("/dog");
	};

	const toCat = () => {
		router.push("/cat");
	};

	return (
		<>
			<Row justify="center">
				<Col span={12}>
					<Text
						strong
						style={{ justify: "center", textAlign: "center" }}
					>
						강아지
					</Text>
				</Col>
				<Col span={12}>
					<Text strong>고양이</Text>
				</Col>
			</Row>

			<Row justify="center">
				<Col span={12}>
					<Button onClick={toDog}>
						<img
							style={{
								display: "block",
								marginLeft: "auto",
								marginRight: "auto",
								width: "100%",
								height: "100%",
							}}
							src={require("../assets/dog.png")}
						/>
					</Button>
				</Col>
				<Col span={12}>
					<Button onClick={toCat}>
						<img
							style={{
								display: "block",
								marginLeft: "auto",
								marginRight: "auto",
								width: "100%",
							}}
							src={require("../assets/cat.png")}
						/>
					</Button>
				</Col>
			</Row>

			<Row justify="center">
				<Col span={12}>
					<Button onClick={toDog}>멍</Button>
				</Col>
				<Col span={12}>
					<Button onClick={toCat}>냥</Button>
				</Col>
			</Row>
		</>
	);
};

export default Home;
